const conta = {
    email: 'zezin@gmail.com',
    password: '123456',
    name: 'José',
    balance: 2000.00,
    id: '1'
}

export const api = new Promise((retorno) => {
    setTimeout(() =>{
        retorno(conta)
    }, 1000)
})
